INSERT INTO `news` (`id`, `name`, `text`, `time`, `author`, `fulltext`, `uploadfile`, `views`, `comments`) VALUES
(11, 'Запуск сайта!', '<p>Запуск сайта, проекта Energy.</p>\r\n', '2015-12-11 18:35:08', 'Enrico', '<p>Уважаемые игроки, сегодня 13.12.2015. Мы запускаем наш сайт и систему автопопления донат счета.</p>\r\n\r\n<p>Приятного использования сайта!</p>\r\n', 'img/news/open.png', 375, 6),
(12, 'Обновление от 14.12', '<p>Обновление, нажми подробнее, чтобы прочитать!</p>\r\n', '2015-12-14 06:02:21', 'Enrico', '<p>- Убран лишний маппинг из мода<br />\r\n- СТО перенесено, найти можно /gps =&gt; Бизнесы =&gt; Тюнинг<br />\r\n- Добавлена сцена и новая парковка у Мэрии<br />\r\n- SWAT перенесен к Вокзалу ЛС<br />\r\n- Банк перенесен, найти можно в /gps</p>\r\n\r\n<p>- Добавлен бассейн в дом</p>\r\n', 'img/news/gallery11.jpg', 309, 2),
