(14, 'Авто Пополнение счета!', '<p>Открой и прочитай!</p>\r\n', '2015-12-28 23:01:48', 'Enrico_Joker', '<p><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Урок пополнения донат счета.</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Любое пополнение через какое-либо лицо, точнее Владислава, Никиту, Дмитрия - НЕ ЯВЛЯЕТСЯ ОФИЦИАЛЬНЫМ! Более подробно в видео!</span></p>\r\n\r\n<h2 style="font-style: italic; text-align: center;"><a href="https://www.youtube.com/watch?v=AEsf5xUwNW4"><span style="color:#FF0000"><span style="font-size:18px"><strong>ВИДЕО</strong></span></span></a></h2>\r\n', 'img/news/Screenshot_1.png', 102, 3);
