(1, 'С чего начинать игру на сервере', '<p><strong>Шаг 1: Установка игры.</strong><br />\r\n<br />\r\n<strong>1.</strong>&nbsp;Скачайте торрент с игрой&nbsp;<a href="http://samp-hoster.ru/download/gta-san-andreas-pc.torrent">GTA San Andreas</a>&nbsp;<br />\r\n<strong>2.</strong>&nbsp;Запустите скачанный&nbsp;<a href="http://samp-hoster.ru/download/gta-san-andreas-pc.torrent">торрент</a>&nbsp;в программе. После того, как игра скачается, смонтируйте образ с помощью программы&nbsp;<a href="http://www.daemon-tools.cc/rus/downloads" target="_blank">DAEMON Tools</a>&nbsp;и запустите файл&nbsp;<em>gta_sa.exe</em>&nbsp;<br />\r\n<strong>3.</strong>&nbsp;Следуйте инструкции установки и соглашайтесь со всем, что вам предложет установочный дистрибутив.<br />\r\n<br />\r\n<strong>Шаг 2: Установка мультиплеера.</strong><br />\r\n<br />\r\n<strong>1.</strong>&nbsp;Скачайте мультиплеер нужной версии. В данном случае это -&nbsp;<a href="http://files.sa-mp.com/sa-mp-0.3z-R1-install.exe">SA:MP 0.3</a>.7&nbsp;<br />\r\n<strong>2.</strong>&nbsp;Запустите скачанный&nbsp;<a href="http://files.sa-mp.com/sa-mp-0.3e-install.exe">дистрибутив</a><br />\r\n<strong>3.</strong>&nbsp;Установите мультиплеер в папку с&nbsp;<a href="http://samp-hoster.ru/download/gta-san-andreas-pc.torrent">GTA San Andreas</a>&nbsp;<br />\r\n<strong>4.</strong>&nbsp;В папке с игрой появится ярлык&nbsp;<em>samp.exe</em>, запустите его.&nbsp;<br />\r\n<br />\r\n<em>Если потребуется, создайте ярлык для samp и поместите его на рабочий стол (не обязательно, но иначе придется каждый раз запускать samp из папки с игрой)</em><br />\r\n<br />\r\n<strong>Шаг 3: Добавление серверов для игры.</strong><br />\r\n<br />\r\n<strong>1.</strong>&nbsp;После запуска у Вас должно появиться окно мультиплеера:<br />\r\n<a href="http://samp-hoster.ru/img/pages/samp1.png" target="_blank"><img alt="" src="/img/pages/samp1.png" style="height:431px; margin:0px; width:629px" /></a><br />\r\n<br />\r\n<strong>2.</strong>&nbsp;Придумайте ник для персонажа и впишите его в нужную ячейку:&nbsp;<br />\r\n<br />\r\n<a href="http://samp-hoster.ru/img/pages/samp2.png" target="_blank"><img alt="" src="/img/pages/samp2.png" style="height:449px; margin:0px; width:629px" /></a><br />\r\n<br />\r\n<strong>3.</strong>&nbsp;Добавьте сервер для игры, как показано на картинке:&nbsp;<br />\r\n<br />\r\n<a href="http://samp-hoster.ru/img/pages/samp3.png" target="_blank"><img alt="" src="/img/pages/samp3.png" style="height:431px; margin:0px; width:629px" /></a><br />\r\n<br />\r\nСервер:&nbsp;176.32.37.93:7777&nbsp;<br />\r\n<br />\r\n<strong>4.</strong>&nbsp;Кликните 2 раза по строке с сервером и в окне нажмите&nbsp;<em>Connect</em>:&nbsp;<br />\r\n<br />\r\n<a href="http://samp-hoster.ru/img/pages/samp3.png" target="_blank"><img alt="" src="/img/pages/samp4.png" style="height:266px; margin:0px; width:294px" /></a><br />\r\n<br />\r\n<strong>Шаг 4: Начало игры.</strong><br />\r\n<br />\r\nПосле входа на сервер, Вам будет предложено зарегистрироваться. Вам будет необходимо придумать пароль, по которому в последующем, Вы будете заходить на сервер за свой аккаунт, так что обязательно запомните этот пароль, а так же ник, который Вы себе придумали. После регистрации следуйте подсказкам</p>\r\n'),
(2, 'Правила сервера', '<p><span style="font-size:14px"><strong><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans">Основное:&nbsp;</span></strong></span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Role-Play - (сокращение Rp) Реальная игра, реальное поведение, как в жизни, игра по ролям&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Non Role-Play - (Сокращение NonRp) Не реальная игра, действие, как данный персонаж не поступил бы в жизни. Нарушение Rp режима&nbsp;</span><br />\r\n<br />\r\n<span style="font-size:14px"><strong><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans">Администраторские термины, наказания:&nbsp;</span></strong></span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Админ/Администратор - персонаж контролирующий соблюдение правил на сервере, с возможностью наказания.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Ban - Наказание после которого, игрок, не сможет продолжить игру на сервере.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Warn - Наказание после которого, игрок будет уволен из организации, и не сможет вступить обратно, или в другую организацию.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Kick - Окончание игрового сеанса.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Бан чата - Игрок не сможет писать сообщения в чаты. Дается на 5мин или более.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Форт ДеМорган - Тюрьма на военной базе, из которой вы не сможете выбраться с помощью адвокатов&nbsp;</span><br />\r\n<br />\r\n<span style="font-size:14px"><strong><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans">Термины, названия действий игрока:&nbsp;</span></strong></span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Revenge kill - убить игрока, за то что он убил тебя.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Mеtagаming - использование OOC информации в IC.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Powergaming - Воображение из себя супер героя. Пример: драка 1х3&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Bunnyhopping - прыгать, чтобы быстрее передвигаться.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Deatmatch - (сокращение ДМ) убивать всех подряд без IC причины.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">DriveBy - (Сокращение ДБ) Убийство машиной или с расстрел с водительского места.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Spawn kill - Убийство на респауне (на месте появления).&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Team kill - Убийство члена своей команды, фракции.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Сharacter kill (Сокращение CK) - убийство, с целью полностью ликвидировать какого-либо персонажа, участвующего в игре. Другими словами - убийство с целью по Rp расстаться с человеком. Ярким примером служит увольнение из мафии. Является частью отыгрывания Rp. Не приветствуется администрацией!&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">FastReload - Баг с быстрой перезарядкой.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">RepeatKill - Намеренное ,повторное убийство одного и того же игрока.&nbsp;</span><br />\r\n<br />\r\n<span style="font-size:14px"><strong><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans">Остальные термины:&nbsp;</span></strong></span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">OOC (Out Of Character) - это все, что касается реального мира. (пишется в /b чат)&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">IC (In Character) - это все, что касается виртуального мира, то есть игры. (пишется в обычный чат)&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">AFK - Away From Keyboard - Отошел от клавиатуры.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Role-Play Nickname - ник в формате: Имя_Фамилия. Пример:Tony_Soprano.&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Фракция - Организация, банда, мафия и т.д. Пример: Grove,LV Army, SF News&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Newbie (Noob) - новичок, игрок непонимающий сути игры RP, игрок не умеющий играть. На игровом сленге - &quot;Нуб&quot;&nbsp;</span><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Spawn (ReSpawn) - Место появления персонажа на сервере. На игровом сленге - &quot;Респ&quot;&nbsp;</span><br />\r\n<br />\r\n<strong><span style="font-size:14px"><span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans">Правила:&nbsp;</span></span></strong><br />\r\n<span style="color:rgb(0, 0, 0); font-family:tahoma,arial,verdana,sans-serif,lucida sans; font-size:11px">Non Role-Play, Revenge kill, Mеtagаming, Powergaming, Bunnyhopping, Deatmatch, DriveBy, Spawn kill, Team kill, Сharacter kill, FastReload, RepeatKill - Всё это NonRp и запрещено на сервере!&nbsp;</span></p>\r\n\r\n<div class="&lt;span class=">\r\n<p>&nbsp;</p>\r\n</div>\r\n'),
