(4, 'Контакты', '<p style="text-align:center"><strong>Как с нами связаться?</strong></p>\r\n\r\n<p>Наша группа: <a href="http://vk.com/enrp1">vk.com/enrp1</a></p>\r\n\r\n<p>Skype тех. раздела: sergey.k1991</p>\r\n\r\n<p style="text-align:right"><u><strong><span style="font-size:9px">Все важные контакты есть в блоке группы! Другие люди не имеют отношения к проекту!</span></strong></u></p>\r\n'),
(406, 'Как пополнить счет?', '<h3>Как пополнить счет с помощью системы WM-кошелька?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Электронным кошельком&raquo;, далее любой доступный Вам WM-кошелек. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как пополнить счет с помощью Яндекс.Кошелька?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Электронным кошельком&raquo;, далее Яндекс.Деьнги. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как оплатить с помощью кошелька в системе Qiwi?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Электронным кошельком&raquo;, далее Qiwi Wallet. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как оплатить через терминалы Qiwi?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Терминалы оплаты&raquo;, далее Qiwi Wallet. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как пополнить счет с помощью счета PayPal?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Электронным кошельком&raquo;, далее PayPal. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как пополнить счет с помощью мобильного телефона?</h3>\r\n\r\n<p>Попав на страницу выбора способа оплаты, выберите вкладку &laquo;Мобильным телефоном&raquo;, далее Ваш оператор связи. Затем в открывшейся форме оплаты введите желаемую к пополнению сумму, а также Ваш номер телефона в международном формате и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n\r\n<h3>Как пополнить счет с помощью пластиковой карты?</h3>\r\n\r\n<p>Данная услуга доступна в Вашем Личном кабинете, в разделе &laquo;Пополнить баланс&raquo;. Попав на страницу выбора способа оплаты, выберите другой метод оплаты и в выпадающем списке доступных способов оплаты выберите &laquo;Банковской картой&raquo;. Далее введите желаемую к пополнению сумму и нажмите оплатить. Следуете дальнейшим инструкциям платежной системы.</p>\r\n'),
